import React from 'react'
import axios from 'axios'

function Note(props) {
    const {_id, title, content} = props.note

    
    const handleDelete = async (note)  => {
        const newBoard = props.board.filter(item => item._id !== note._id)
        console.log(newBoard)
        axios.delete(`/notes/${_id}`).then(props.setBoard(newBoard))
       
    }

    

   


    return (
        <div className = 'note'>
            <h1>{title}</h1>
            <div>
                <span>{content}</span>
            </div>
            <button onClick = {handleDelete} > delete</button>

        </div>
    )
}

export default Note
